   David Dimbleby presents a look back at Nelson Mandela's
life - including interviews Dimbleby conducted with Mandela
in 2003. World leaders and well-known artists commenting
on Mandela's life include Bill Clinton, Archbishop Tutu, Bob
Geldof, Annie Lennox and Lenny Henry.
